import React, {Component} from 'react';
// import logo from './logo.svg';
import './App.css';
import RouterRoutes from "./RouterRoutes";


class App extends Component {
  render() {


    return (
        <div className="App" >


          <RouterRoutes/>



        </div>
    );
  }
}

export default App;
